import './Contact.css';

const Contact = () => {
  return (
    <div className="contact-page">
      <div className="container py-5">
        <h1 className="text-white mb-4">Contact Us</h1>
        <p className="text-gray">Contact page content coming soon...</p>
      </div>
    </div>
  );
};

export default Contact;
